&nbsp; Er verzog keine Miene, sondern sah mich weiter stumm mit seinem Migr&auml;neblick an. Ein netter Mensch h&auml;tte ihm eine Packung Aspirin schenken sollen. Ich war kein netter Mensch.
&nbsp; &quot;Ich mach Ihnen einen Vorschlag, wie Sie sich m&uuml;hsammes Sprechen ersparen k&ouml;nnen. Wenn Sie mit dem linken Ohr wackeln, bedeutet es &gt;Ja&lt;, mit dem rechten &gt;Nein&lt;, und ich darf nur drei direkte Fragen stellen. In Ordnung?&quot;
&nbsp; Anstatt mit dem rechten Ohr zu wackeln, sagte er: &quot;Nein.&quot;

&nbsp; &quot;Ich h&auml;tte gern ein Pils&quot;, wiederholte ich und legte zwei Mark in den Geldteller.
&nbsp; &quot;Wolle Se net gleisch saache, wiefel Se hawwe wolle, dann mus isch net dauernt hi und her renne.&quot;
Sie war Profi.
&nbsp; &quot;Also gut, dann gleich zwei.&quot;
&nbsp; &quot;Sehn Se!&quot;
